import { Grid } from '@mui/material'
import React from 'react'
import banner1 from '../assets/WhatsApp Image 2024-11-15 at 8.28.08 PM.jpeg'

const Banner = () => {
  return (
    <Grid container>
      <Grid item>
      <img
                  src={banner1}
                  alt={banner1}
                  style={{ width: '90%', height:  '200px'  }}  // Adjust image height for tablet
                />
      </Grid>
    </Grid>
  )
}

export default Banner
